import './App.css';
import Homepage from "./HomePage";
import {
	BrowserRouter as Router,
	Routes,
	Route,
	Link
} from 'react-router-dom';


function App() {
return (
	<>
    <Homepage/>
    <Route exact path="/home" component={Homepage} />
	</>
);
}

export default App;
